CREATE PROCEDURE seriea.factMatches_INSERT AS BEGIN INSERT INTO  seriea.factMatches SELECT match_id, team_id, home_or_away, expected_goals, expected_goals_assists, not_penalty_xg, not_penalty_xg_assists, passes_defensive_action_attack, passes_defensive_action_defence, deep_passes, deep_passes_allowed, goals_scored, goals_conceded, expected_points, match_outcome, date, wins, draws, loses, points, non_penalty_xg_diff, season FROM [landingdb].seriea.factMatches END